// Lambda style
NSNotificationCenter.DefaultCenter.AddObserver (
        NSView.NSViewBoundsDidChangeNotification, (notification) => {Console.WriteLine ("Received the notification NSView", notification); }


// Method style
void Callback (NSNotification notification)
{
    Console.WriteLine ("Received a notification NSView", notification);
}

void Setup ()
{
    NSNotificationCenter.DefaultCenter.AddObserver (NSView.NSViewBoundsDidChangeNotification, Callback);
}

